content.server_on_load:
async ({
  template,
  params,
  render,
  db,
  req,
  reply,
  user,
  log,
  ext,
  isDev,
}: Server) => {
  const getdata = async () => {
    try {
      const data = await db.proses_Apply.findMany({
        include: {
          User: true,
        },
        orderBy: {
          createdAt: "desc",
        },
      });
      reply.send({
        data: data,
      });
    } catch (e) {
      reply.send("not found").code(404);
    }
  };

  getdata()
}
